import React, {useState} from 'react';

const Data = ({prop}) => { 

	const {id, detail} = detail;

	console.log("Data.js",this.props);

	return(
		<div className="container">
			<div className="row">
				<div className="col-sm-12">
					<p className="text-left">
						{detail}
					</p>
				</div>
			</div>
		</div>
	);	
}

export default Data
